CREATE TABLE zz_commons.partner (
    p_id integer NOT NULL,
    p_name text NOT NULL,
    p_shipping_countries varchar[] NOT NULL,
    p_appdomain_ids smallint[],
    p_last_modified timestamp without time zone NOT NULL DEFAULT clock_timestamp(),
    p_remote_server_name text NOT NULL,
    p_stock_id smallint NULL,
    p_type INTEGER NOT NULL, -- type from partner service table
    p_is_price_calculation_enabled boolean NOT NULL DEFAULT FALSE,
    p_ranking integer NOT NULL DEFAULT 100,
    p_creditor_number text,
    p_tax_key varchar(8) NOT NULL DEFAULT 'A1',
    p_tax_rate integer NOT NULL DEFAULT 1900,
    p_parcel_services zz_commons.parcel_service[] NOT NULL,
    p_parcel_service_types zz_commons.parcel_service_type[] NOT NULL,
    p_legal_form text NOT NULL,
    PRIMARY KEY (p_id )
);

ALTER TABLE zz_commons.partner OWNER TO zalando;

COMMENT ON TABLE zz_commons.partner IS 'a partner is using the zalando platform to offer and sell his own articles. the shipping is handled by the partner';
COMMENT ON COLUMN zz_commons.partner.p_stock_id IS 'a reference to the stock of the partner';
COMMENT ON COLUMN zz_commons.partner.p_name IS 'the name of the partner';
COMMENT ON COLUMN zz_commons.partner.p_shipping_countries IS 'countries this partner delivers to';
COMMENT ON COLUMN zz_commons.partner.p_remote_server_name IS 'name of the shard where entities for the partner is persisted';
COMMENT ON COLUMN zz_commons.partner.p_is_price_calculation_enabled IS 'price calculation for that partner is enabled';
COMMENT ON COLUMN zz_commons.partner.p_ranking IS 'Price calculation ranking. A lower rank means this partner will be preferred over others.';
COMMENT ON COLUMN zz_commons.partner.p_creditor_number IS 'Zalando SAP Creditor Number';
COMMENT ON COLUMN zz_commons.partner.p_tax_key IS 'Key used to determine Value Added Tax handling for Partner';
COMMENT ON COLUMN zz_commons.partner.p_tax_rate IS 'Value used to determine Value Added Tax handling for Partner';
COMMENT ON COLUMN zz_commons.partner.p_parcel_services IS 'Parcel Services supported by Partner';
COMMENT ON COLUMN zz_commons.partner.p_parcel_service_types IS 'Parcel Service selection type for Shop Frontend';
COMMENT ON COLUMN zz_commons.partner.p_legal_form IS 'Company name of Partner Company - may differ from Partner Name';


